import React from 'react'
import Template from '../components/Template'

const Login = () => {
  return (
    <Template
        title="Welcome Back"
        desciption1="Build skills for today, tomorrow, beyond."
        description2="Education to future-proof your career."
        image={loginImg}
        formType="login"
    />
  )
}

export default Login
